import "./App.css";
import React, { Component } from "react";
import env from "react-dotenv";

class App extends Component {
  state = {
    data: [],
    getData: false,
  };

  componentDidMount = async () => {
    const key = env.API_KEY;
    const urlSearch =
      "/api/charities/v2/search?name=bike&fields=id,name,address,abstract&results=20&page=2";
    const myHeaders = new Headers();
    myHeaders.append("X-API-Key", key);

    const requestOption = {
      method: "GET",
      headers: myHeaders,
    };

    const response = await fetch(urlSearch, requestOption);
    const data = await response.json();
    this.setState({
      data: data.charities,
      getData: true,
    });
  };

  render() {
    const { data, getData } = this.state;
    return (
      <div>
        <h1>SEARCH</h1>
        <input id="search"></input>
        {getData && data.map((item) => <div key={item.id}>{item.name}</div>)}
      </div>
    );
  }
}

export default App;
